import { useState } from 'react';
import './App.css';

function App() {
  const [count, setCount] = useState(0);

  function handleGreatButton(e) {
    setCount(count + 1)
    }

  function handleBoringButton() {
    setCount(count - 1)
  }

  return (
    <>
    <h1>How do you like the lecture?</h1>
    <button onClick={handleGreatButton}>It's great!</button>
    <button>Ok'isch</button>
    <button onClick={handleBoringButton}>Boring!</button>
    <h2>Total score: {count}</h2>
    </>
  );
}

export default App;
